import React from "react";

function Contact() {
  return (
    <section id="contact" className="section">
      <h2>Contact</h2>
      <p>Email: yourname@example.com</p>
      <p>LinkedIn: linkedin.com/in/yourname</p>
      <p>GitHub: github.com/yourname</p>
    </section>
  );
}

export default Contact;
